import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Typography } from "@mui/material";
import Axios  from "axios";
import { useState, useEffect } from "react";

function MarketTable({ data, title }) {
    const [headers, setHeaders] = useState([]);
    const [apiData, setApiData] = useState([]);
    useEffect(() => {
        const fetchData = async () => {
          try {
            const response = await Axios.get(data); // Replace with actual API
            if (Array.isArray(response.data) && response.data.length > 0) {
                const firstRowKeys = Object.keys(response.data[0]);
                console.log("Extracted Headers:", firstRowKeys);
      
                setHeaders((prevHeaders) =>
                  prevHeaders.length === 0 ? firstRowKeys : prevHeaders
                );
                setApiData(response.data);
                console.log("Updated Data:", response.data);
              } else {
                console.warn("API returned an empty array or unexpected data format");
              }
          } catch (error) {
            console.error("Error fetching data:", error);
          }
        };
    
        fetchData();
        console.log(headers);
        console.log(apiData);
      }, []);
  if (data.length === 0) return <p>Loading...</p>;

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            {headers.map((header) => (
              <TableCell key={header}>{header}</TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {apiData.map((row, rowIndex) => (
            <TableRow key={rowIndex}>
              {headers.map((header) => (
                <TableCell key={header}>{row[header]}</TableCell>
              ))}
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
export default MarketTable;
